INSERT INTO `projektcategory_lang` VALUES (1,1,1,'Baza','','baza','','',''),(2,1,1,'Strona główna','','strona-glowna','','',''),(22,1,1,'Plakaty','W tym miejscu znajdziesz pełną ofertę stylowych plakatów i grafik! Mamy szeroki katalog plakatów pasujących do większości domów i stylów wystroju wnętrz. Ciągle udoskonalamy naszą ofertę, dodając do niej najpopularniejsze, a także ekskluzywne wzory plakatów. Dzięki temu zawsze znajdziesz u nas coś dla siebie. Odśwież wygląd swoich ścian i ozdób je modnymi plakatami Desenio!','plakaty','Plakaty','','Stylowe plakaty, grafiki i obrazy do kupienia online. Jesteśmy sklepem internetowym z nowoczesnymi i przystępnymi cenowo plakatami online. U nas zawsze znajdziesz najnowsze trendy i plakaty odznaczające się ponadczasowym designem.'),(25,1,1,'Plakaty z napisami','W kategorii „Plakaty z napisami” znajdziesz między innymi piękne, skłaniające do myślenia cytaty i złote myśli z przymrużeniem oka. Plakaty z napisami świetnie komponują się z fotografią i grafiką, tworząc galerie ścienne, i pasują do większości pomieszczeń oraz stylów wystroju wnętrz.','plakaty-z-napisami','Plakaty z napisami','','Plakaty z napisami, cytatami, złotymi myślami i przesłaniem. Udekoruj wnętrza swojego domu za pomocą stylowego plakatu z tekstem. W naszej ofercie znajdziesz szykowne plakaty z napisami, literami, pięknymi cytatami i wzorami graficznymi oraz złotymi myśla'),(26,1,1,'Czarno-białe','Czerń i biel są zawsze na topie! Dzięki czarno-białym plakatom na ścianie można swobodnie zmieniać i dodawać kolory do własnych wnętrz. Mamy w ofercie wiele czarno-białych plakatów we wszystkich kategoriach, od pięknych fotografii po ilustracje graficzne i czarno-białe motywy ze świata natury.','czarno-biale-plakaty','Czarno-białe','','Czarno-białe plakaty i obrazy online. U nas znajdziesz duży wybór czarno-białych obrazów z grafikami, tekstem, ilustracjami oraz wzorami graficznymi. Wiele stylowo wyglądających plakatów i obrazów pasuje do wystroju wnętrz w czarno-białej tonacji. Mamy ró'),(29,1,1,'Natura i krajobrazy','Odkryj dostępne u nas plakaty z motywami przedstawiającymi naturę w wielu różnych stylach, zarówno w kolorze, jak i czarno-białej tonacji. Ściany ozdobione zdjęciami z przyrodą wprowadzają do pomieszczenia spokój i harmonię. Udekoruj ściany motywami z wzburzonym morzem, bujnym lasem lub widokami z górskich szczytów. Nasza szeroka oferta pasuje do wielu stylów wystroju wnętrz.','natura-i-krajobrazy','Natura i krajobrazy','','Obrazy z motywami przyrodniczymi, fotografie przyrodnicze i piękne obrazy inspirowane naturą. Wybierz coś dla siebie spośród pięknych fotografii przedstawiających morze i plażę, zielone lasy, urokliwe jeziora i zapierające dech w piersiach zdjęcia nieba.'),(48,1,1,'Ramki','Wykorzystaj nasze wysokiej jakości ramki do plakatów i zdjęć i stwórz kompletną galerię na ścianie. Oferujemy eleganckie ramki do zdjęć w kolorze czarnym, białym i kolorze dębu, a także ramki metalowe w kolorze złotym, srebrnym i miedzianym. Ramki są dostępne w ośmiu rozmiarach, od małych ramek do zdjęć o wymiarach 13 x 18 cm, po duże ramki do plakatów o wymiarach 70 x 100 cm.','ramki','Ramki','','Kupuj ramki online, na stronie internetowej Desenio! Oferujemy ramki w różnym stylu i różnych rozmiarach. Pasują do wszystkich naszych plakatów. Kup ramkę online, na stronie Desenio — niskie ceny i wysoka jakość.'),(140,1,1,'Czarne drewniane ramki','Wysokiej jakości czarne drewniane ramki można z łatwością otworzyć od tyłu i włożyć w nie plakat. Mają elegancki, smukły profil i płasko przylegają do ściany. Ozdób swoją ścianę z obrazami, łącząc te ramki z naszymi czarnymi, metalowymi klipsami.','czarne-drewniane-ramki','Czarne drewniane ramki','','Kup czarne ramki do swoich plakatów. Na stronie internetowej Desenio znajdziesz nasze stylowe czarne, drewniane ramki dostępne w różnych rozmiarach i w świetnych cenach.'),(141,1,1,'Białe drewniane ramki','Wysokiej jakości białe drewniane ramki można z łatwością otworzyć od tyłu i włożyć w nie plakat. Mają elegancki, smukły profil i płasko przylegają do ściany. Białe ramki można szykownie połączyć z ramkami w kolorze dębu, nadając ścianie z obrazami stylowego, skandynawskiego charakteru.','biale-drewniane-ramki','Białe drewniane ramki','','Kupuj białe ramki online w Desenio. W naszym sklepie internetowym znajdziesz stylowe, drewniane ramki do plakatów i zdjęć. Dobra jakość i wspaniałe ceny, zamawiaj online.'),(143,1,1,'Dębowe ramki','Wysokiej jakości ramki z surowego dębu można z łatwością otworzyć od tyłu i w prosty sposób umieścić w nich plakat. Mają elegancki, smukły profil i płasko przylegają do ściany. Na ścianie z obrazami ramki dębowe można połączyć z naszymi zawieszkami do plakatów i dębowymi klipsami Moebe, tworząc eleganckie zestawienie.','debowe-ramki','Dębowe ramki','','Dębowe ramki. Oferujemy szeroki wybór wysokiej jakości niedrogich, dębowych ramek w różnych rozmiarach i kolorach. Zamów na stronie internetowej Desenio.'),(144,1,1,'Złote ramki','Wysokiej jakości złote ramki można z łatwością otworzyć od tyłu i włożyć w nie plakat. Mają elegancki, smukły profil i płasko przylegają do ściany. Złote ramki doskonale się zaprezentują na ścianie z obrazami w połączeniu z naszymi złotymi klipsami do plakatów.','zlote-ramki','Złote ramki','','Kupuj online stylowe i niedrogie złote ramki. Oferujemy złote ramki w 8 różnych rozmiarach. Zamawiaj online ramki i plakaty z szybką dostawą.'),(145,1,1,'Miedziane ramki','Ożyw swoje plakaty dzięki naszym wysokiej jakości miedzianym ramkom o eleganckim, nowoczesnym wyglądzie. Mają elegancki, smukły profil i płasko przylegają do ściany.','miedziane-ramki','Miedziane ramki','','Kupuj stylowe miedziane ramki online. Oferujemy niedrogie miedziane ramki do plakatów i zdjęć w różnych rozmiarach — z łatwością i bezpiecznie kupisz je w Desenio.'),(226,1,1,'Kalendarze na 2021 rok','Udekoruj wnętrze za pomocą plakatu, który jest i stylowy, i praktyczny – kalendarz ścienny na 2021 rok! Udekoruj swoje ściany za pomocą stylowego plakatu przedstawiającego kalendarz, nadającego się zarówno do biura, jak i do kuchni.','kalendarze','Kalendarze na 2021 rok','','Kup kalendarz ścienny na 2021 rok online w Desenio. Stylowe kalendarze ścienne w formie plakatów do zawieszenia w domu. Dopilnuj, żeby wystrój Twoich wnętrz był ciągle na czasie i co roku wieszaj nowy kalendarz! Kalendarz w formie plakatu'),(424,1,1,'Lasy','Poznaj naszą szeroką gamę obrazów z leśnymi krajobrazami w różnych stylach i wybierz reprodukcję, która podoba Ci się najbardziej. Dzięki zdjęciom przedstawiającym leśny krajobraz w Twoim domu zapanuje spokój. Wszystkie nasze reprodukcje z tej kolekcji można łatwo łączyć w zestawy w barwach ziemi.','lasy','Lasy','','Kup plakaty z krajobrazem leśnym. Nasze plakaty przedstawiające krajobraz las stworzą spokojną i relaksującą atmosferę. Kupuj online w Desenio.pl'),(427,1,1,'Morza i oceany','Głęboki odcień błękitu nigdy nie prezentował się lepiej! W kategorii zdjęć morskich pejzaży znajdują się reprodukcje z motywami jezior i oceanu w różnych stylach, odpowiadające różnym gustom. Przeglądaj reprodukcje z naszej kolekcji zdjęć z motywami morskich pejzaży i znajdź takie, które podobają Ci się najbardziej. Możesz dobrać do nich odpowiednie ramki i stworzyć ścianę z obrazami.','morza-i-oceany','Morza i oceany','','Kupuj plakaty przedstawiające pejzaż morski. Odkryj plakaty z relaksującymi zdjęciami wody i miejscami jak ze snów. Kupuj online w Desenio.pl'),(430,1,1,'Krajobrazy','Wśród plakatów z krajobrazami znajdują się reprodukcje przedstawiające wszystkie najpiękniejsze miejsca na Ziemi. Poznaj naszą szeroką ofertę reprodukcji i wybierz plakaty z krajobrazami, które najbardziej przypadną Ci do gustu – a następnie połącz je na wyjątkowej ścianie z obrazami. Nasza planeta to niezwykle piękne miejsce – i to piękno chcemy uhonorować na plakatach z krajobrazami.','krajobrazy','Krajobrazy','','Odkryj nasze plakaty z krajobrazami online. Kupuj plakaty ze zdjęciami pięknych krajobrazów i widoków z całego świata w Desenio.pl'),(436,1,1,'Góry','Rzuć wszystko i ruszaj w góry! W naszej szerokiej ofercie plakatów z górami każdy znajdzie coś dla siebie: reprodukcje w różnych stylach i kolorach oraz czarno-białe. Sprawdź, jakie plakaty oferujemy i wybierz produkt, który najlepiej będzie pasował do wystroju Twojego domu.','gory','Góry','','Odkryj naszą kategorię góry. Kup plakaty z motywami, zdjęciami i wzorami przedstawiającymi góry i szczyty górskie w Desenio.pl'),(448,1,1,'Niebo','Ruszaj ku niebu! Zdjęcia przedstawiające niebo nigdy nie wyjdą z mody. W naszej ofercie mamy zdjęcia nieba w różnych stylach i kolorach – na pewno znajdziesz coś dla siebie. Wybierz reprodukcje w żywych kolorach, barwach pastelowych lub czerni i bieli, które będą pasować do Twojego domu.','niebo','Niebo','','Kupuj zdjęcia nieba i plakaty. Plakaty czarno-białe, w żywych kolorach i pastelowych odcieniach. Kup teraz w Desenio.pl'),(451,1,1,'Plakaty z cytatami','Wyraź siebie dzięki obrazom z cytatami. W tej kategorii zebraliśmy wszystkie nasze obrazy z tekstem i cytatami. Znajdziesz tu obrazy z różnymi cytatami: śmiesznymi, inspirującymi i takimi, które codziennie będą Ci przypominać o tym, co najważniejsze. Są one dostępne, między innymi w wersji czarno-białej, kolorowej i z ilustracjami graficznymi. Wybierz swój ulubiony plakat i powieś go na ulubionej ścianie w domu.','plakaty-z-cytatami','Plakaty z cytatami','','Odkryj naszą kategorię Obrazy z cytatami. Plakaty z humorystycznymi, inspirującymi cytatami i wiele innych! Kup teraz w Desenio.pl'),(454,1,1,'Litery','Ściana dekoracyjna z plakatami typograficznymi to wyjątkowy element wystroju wnętrza. W naszej ofercie znajdziesz sztukę z literami w różnych kolorach i stylach – plakaty ze wszystkimi literami alfabetu. Mamy dla Ciebie doskonałe produkty zarówno do pokoju dziecięcego, jak i salonu.','litery','Litery','','Kup sztukę z literami online! Oferujemy plakaty z literami alfabetu w wielu różnych stylach. Kup już dziś w Desenio.pl'),(460,1,1,'Motywacyjne','Plakaty i reprodukcje motywacyjne nigdy nie wyjdą z mody. W tej kategorii zebraliśmy nasze najlepsze propozycje. Poznaj naszą szeroką ofertę plakatów motywacyjnych i znajdź takie, które najbardziej przypadną Ci do gustu. Plakat motywacyjny będzie codziennie przypominać Ci o tym, co jest najważniejsze i nie pozwoli Ci poddać się stresowi.','motywacyjne','Motywacyjne','','Kup plakaty motywacyjne online. Odkryj całą naszą kolekcję motywacyjnych, inspirujących i dodających pewności siebie plakatów! Kup w Desenio.pl'),(463,1,1,'Typografia','Plakaty typograficzne pasują do wszystkich wnętrz. W tej kategorii znajdziesz plakaty typograficzne w wersji czarno-białej i kolorowej oraz w różnych stylach i z różną czcionką. Łatwo więc wybierzesz taki, który najlepiej będzie pasować do Twojego domu. W naszej szerokiej ofercie każdy znajdzie coś dla siebie. Plakaty typograficzne świetnie sprawdzą się jako osobisty akcent na ścianie z obrazami.','typografia-2','Typografia','','Kup plakaty typograficzne online! Odkryj nasze plakaty typograficzne w różnych stylach i kolorach. Kup teraz w Desenio.pl'),(469,1,1,'Humor','Gwarantujemy, że przeglądając produkty w tej kategorii nie powstrzymasz się od śmiechu. Śmieszne plakaty doskonale sprawdzą się jako osobisty akcent na ścianie z obrazami. Każdy potrzebuje w swoim domu plakatu, dzięki któremu uśmiechnie się za każdym razem, kiedy będzie obok niego przechodzić. Więcej uśmiechu! Więcej radości!','humor','Humor','','Kupuj śmieszne plakaty online. Odkryj śmieszne plakaty z uroczymi cytatami i wzorami. Kup swoje ulubione plakaty już teraz w Desenio.pl'),(1070,1,1,'Holiday Collection','Dzięki naszej nowej kolekcji świątecznej Holiday Collection zdobędziesz wszystko, czego potrzebujesz, aby przygotować dom na nadchodzący sezon świąteczny! Gdy zima i sezon świąteczny pukają do drzwi, plakaty świąteczne z naszej kolekcji zimowej Holiday Collection przygotują ściany Twojego domu na nadejście świąt. Znajdź swoje ulubione plakaty świąteczne i zaproś je do domu na czas przed świętami!','holiday-collection','Holiday Collection','','Świąteczne plakaty artystyczne Desenio – Udekoruj swój dom plakatami i reprodukcjami z naszej najnowszej kolekcji świąteczno-zimowej Holiday Collection. Seria plakatów inspirowanych zimą, Bożym Narodzeniem i sezonem świątecznym. Kupuj na stronie Desenio.p'),(2000,1,1,'Bestsellery','Tutaj znajdziesz nasze najpopularniejsze plakaty i grafiki. Wśród naszych bestsellerów znajdziesz różne ponadczasowe motywy i najnowsze trendy –znajdziesz tu coś do każdego stylu wystroju wnętrz! Podkreśl wygląd swojego domu za pomocą najbardziej stylowych plakatów Desenio.','bestsellery','Bestsellery','','Witamy wśród najpopularniejszych plakatów w Desenio! W tym miejscu zebraliśmy nasze najlepiej sprzedające się plakaty, czyli najpopularniejsze obrazy w różnych stylach i rozmiarach. Plakat to prosty sposób na odnowienie i odświeżenie wyglądu wnętrz za nis'),(2001,1,1,'Nowości','Desenio stawia na klasyczne, jak i najnowsze trendy. Właśnie dlatego zawsze oferujemy nowe wzory plakatów i obrazów. Regularnie publikujemy nowe kolekcje stworzone przez znanych fotografów, artystów i nasz własny zespół kreatywny. Dzięki temu możesz zmieniać wygląd swojego domu w zależności od potrzeb i pór roku.','nowosci','Nowości','','Odkryj najświeższe nowości i zainspiruj się nimi! W Desenio zawsze znajdziesz plakaty i obrazy pasujące do najnowszych trendów w aranżacji wnętrz. Nieustannie aktualizujemy naszą ofertę, poszerzając ją o nowe motywy wykonane różnymi technikami i stylami,');
