INSERT INTO `projektcms_lang` VALUES (1,1,1,'Dostawa','','Nasze warunki i postanowienia dostawy','conditions, delivery, delay, shipment, pack','<h2>Transport i zwroty</h2>\n<h3>Transport twojej paczki</h3>\n<p>Paczki są zazwyczaj dostarczane w ciągu 5-6 dni roboczych.</p>\n<p><img src=\"https://localhost/prestashop/img/cms/123830729_387375845784535_7272286204864276554_n.png\" alt=\"\" width=\"61\" height=\"39\" /></p>\n<h3>Zwroty</h3>\n<p>Towar może zostać zwrócony w przeciągu 6 tygodni od daty nadania.</p>\n<p><img src=\"https://localhost/prestashop/img/cms/123589257_421183599272061_6627939429886690045_n.png\" alt=\"\" width=\"42\" height=\"46\" /></p>','dostawa'),(2,1,1,'Nota prawna','','Nota prawna','notice, legal, credits','<h2>Prawo</h2>\n<h3>Uznanie</h3>\n<p>Koncept i produkcja:</p>\n<p>Ta strona została utworzona dzięki wolnemu oprogramowaniu <a href=\"http://www.prestashop.com\">PrestaShop</a>™.</p>','nota-prawna'),(4,1,1,'O nas','','Dowiedz się więcej o nas','about us, informations','<h2>O nas</h2>\n<p>W Desenio pasjonujemy się wystrojem wnętrz, a szczególnie stylem skandynawskim. Nasz pomysł na biznes jest prosty: stworzenie stylowych dekoracji na ściany powinno być osiągalne dla każdego. W Desenio znajdziesz najszerszą gamę skandynawskich plakatów oraz ramek, zawieszek, klipsów i półek na obrazy. Często dodajemy do naszego asortymentu nowości, aby podążać za najnowszymi trendami stylów wystroju wnętrz i designu skandynawskiego. W ofercie mamy artykuły dekoracyjne, wśród których znajdzie się coś do każdego pomieszczenia i każdego stylu wystroju.</p>\n<p><img src=\"https://localhost/prestashop/img/cms/101293493_2709696849316241_6351657319637450752_n.jpg\" alt=\"101293493_2709696849316241_6351657319637450752_n.jpg\" width=\"800\" height=\"534\" /></p>','o-nas'),(5,1,1,'Bezpieczna płatność','','Nasze sposoby bezpiecznej płatności','secure payment, ssl, visa, mastercard, paypal','<h2>Bezpieczna płatność</h2>\n<h3>W naszym sklepie dokonasz bezpiecznych płatności z użyciem szyfrowania danych za pomocą certyfikatu SSL.</h3>\n<p>Zamawiając towar z dostawą do domu, możecie Państwo zapłacić za zamówiony towar gotówką przy odbiorze lub wybrać inną formę płatności: płatność kartą Visa/MasterCards lub PayPal.</p>\n<h3><img src=\"https://localhost/prestashop/img/cms/123812049_807926649957944_8885427816136407918_n.png\" alt=\"\" width=\"67\" height=\"48\" /></h3>\n<p></p>','bezpieczna-platnosc');
