INSERT INTO `projekthomeslider_slides_lang` VALUES (2,1,'Tysiące możliwości','<p>W twoim domu czegoś brakuje? Odrobiny personalizacji lub dekoracji? Nasz bogaty wybór plakatów i grafik rozwiąże ten problem z łatwością!</p>','Wszystko dla twojego domu','localhost/prestashop/2000-bestsellery','0a4075e6ee0fdce370105a4a8903110f35b0689e_105032769_564139510952203_8449079431222802556_n.jpg'),(3,1,'Najnowsze trendy!','<p>Posiadamy w ofercie asortyment plakatów z fotografiami, klasycznych czarno-białych plakatów, ciekawych obrazów w stylu retro, plakatów z abstrakcyjną sztuką nowoczesną i wiele innych.</p>','Najnowsze trendy!','localhost/prestashop/22-plakaty','07968968fadd0fc8de01095004a96059f307f99e_118908368_684045338876555_4547493159797524541_n.jpg');
