INSERT INTO `projektinfo_lang` VALUES (1,1,1,'<h2 style=\"text-align:center;\">MODNE I STYLOWE OBRAZY DO KAŻDEGO DOMU I KAŻDEGO POKOJU</h2>\n<p style=\"text-align:center;\">Sztuka powinna być dostępna dla każdego!<br />Mamy w ofercie tysiące różnych obrazów z mnóstwem różnorodnych motywów, dlatego mamy nadzieję, że znajdziesz wśród nich obrazy idealnie pasujące do Twojego domu. Desenio chce być dla Ciebie źródłem inspiracji w zakresie wystroju wnętrz i wzornictwa, niezależnie od tego, czy potrzebujesz pomocy przy dekoracji sypialni, niewielkiego przedpokoju, gabinetu czy też całego domu!</p>\n<p></p>');
/*!40000 ALTER TABLE `projektinfo_lang` ENABLE KEYS */;
