INSERT INTO `projektproduct_lang` VALUES (1,1,1,'Graficzna ilustracja przedstawiająca żurawia w kolorach białym i złotym (bez pozłacanej folii) lecącego nad wysoką trawą oraz góry w tle. Ten piękny plakat nada odpowiedni kolor wnętrzu i odświeży Twój dom.','Grafika z żurawiem - Graficzna ilustracja przedstawiająca żurawia w kolorach białym i złotym lecącego nad wysoką trawą i górskim krajobrazem','elegant-flight-plakat','Elegant Flight Plakat  - Graficzna ilustracja przedstawiająca żurawia w kolorach białym i złotym lecącego nad wysoką trawą i górskim krajobrazem - Desenio.pl','elegant, flight, plakat, grafika, z, żurawiem, desenio.pl','Elegant Flight Plakat','Elegant Flight Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(2,1,1,'Ilustração gráfica de duas baleias com padrões, a nadar no oceano, com um cé a branco e dourado de fundo. Arte gráfica é um must em qualquer casa, e que adiciona cor e um toque moderno!','Grafika z wielorybami - Graficzna ilustracja w kolorze niebieskim przedstawiająca dwa wieloryby w wodzie','bond-ii-plakat','Bond II Plakat  - Graficzna ilustracja w kolorze niebieskim przedstawiająca dwa wieloryby w wodzie - Desenio.pl','bond, ii, plakat, grafika, z, wielorybami, desenio.pl','Bond II Plakat','Bond II Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(3,1,1,'Graficzna ilustracja przedstawiająca górski krajobraz w kolorach niebieskim, białym i złotym (bez pozłacanej folii) oraz czerwony księżyc za górą, która odbija się w lustrze jeziora. Sztuka graficzna z kolorowymi detalami doskonale nadaje się do salonu, w którym prace artystyczne mają stanowić główny element!','Grafika z odbiciem góry w wodzie - Graficzna ilustracja przedstawiająca górski krajobraz i księżyc odbijające się w lustrze jeziora','winters-day-plakat','Winters Day Plakat  - Graficzna ilustracja przedstawiająca górski krajobraz i księżyc odbijające się w lustrze jeziora - Desenio.pl','winters, day, plakat, grafika, z, odbiciem, góry, w, wodzie, desenio.pl','Winters Day Plakat','Winters Day Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(4,1,1,'Grafika artystyczna z ciemnożółtym słońcem za czarnym drzewem na beżowym tle. Ekspresyjna, choć stylowa reprodukcja odpowiednia do każdego pomieszczenia. Przetarte kolory nadają temu obrazowi niepowtarzalny wygląd, dzięki czemu wszystko jest jeszcze bardziej interesujący!','Grafika przedstawiająca wschód słońca – Ilustracja graficzna z czarnym drzewem na pierwszym planie i ciemnożółtym słońcem na beżowym tle','winter-morning-plakat','Winter Morning Plakat  – Ilustracja graficzna z czarnym drzewem na pierwszym planie i ciemnożółtym słońcem na beżowym tle - Desenio.pl','winter, morning, plakat, grafika, przedstawiająca, wschód, słońca, desenio.pl','Winter Morning Plakat','Winter Morning Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(5,1,1,'Akwarela z dwoma osobami, z których jedna całuje drugą w policzek, w czarnym kolorze, na białym tle. Ten słodki motyw jest idealny dla kochającej się pary! Stwórz ciepły i kochający dom wypełniony sztuką i wybierz obrazy, które pokazują, co do siebie czujecie. Znajdź więcej obrazów w kategorii Ilustracje!','Akwarelowa para – Czarno-biała akwarelowa ilustracja kobiety całującej mężczyznę w policzek','watercolor-kiss-plakat','Watercolor Kiss Plakat  – Czarno-biała akwarelowa ilustracja kobiety całującej mężczyznę w policzek - Desenio.pl','watercolor, kiss, plakat, akwarelowa, para, desenio.pl','Watercolor Kiss Plakat','Watercolor Kiss Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(6,1,1,'Grafika geometryczna z dwiema twarzami zbliżającymi się do pocałunku, w czarnym kolorze, na białym tle. Jeśli lubisz na minimalistyczny styl, ten abstrakcyjny obraz może się okazać po prostu idealnym wyborem! Wraz z innymi ilustracjami lub grafikami ze świata mody możesz stworzyć wymarzoną ścianę z obrazami.','Grafiki geometryczne z twarzami – Czarno-biała grafika geometryczna z dwiema twarzami zbliżającymi się do pocałunku','almost-kiss-plakat','Almost Kiss Plakat  – Czarno-biała grafika geometryczna z dwiema twarzami zbliżającymi się do pocałunku - Desenio.pl','almost, kiss, plakat, grafiki, geometryczne, z, twarzami, desenio.pl','Almost Kiss Plakat','Almost Kiss Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(7,1,1,'Abstrakcyjna ilustracja w stylu grafik geometrycznych z dwiema całującymi się osobami w uścisku, narysowana w czarnym kolorze na beżowym tle. Grafiki geometryczne zostają z nami na dobre, a wraz z obrazem Abstract Figures No1 lub Abstract Figures No3 stworzysz doskonałą kompozycję!','Grafika geometryczna z pocałunkiem – Abstrakcyjna ilustracja z dwiema osobami narysowanymi w stylu grafik geometrycznych, całującymi się w objęciach','abstract-figures-no2-plakat','Abstract Figures No2 Plakat  – Abstrakcyjna ilustracja z dwiema osobami narysowanymi w stylu grafik geometrycznych, całującymi się w objęciach - Desenio.pl','abstract, figures, no2, plakat, grafika, geometryczna, z, pocałunkiem, desenio.pl','Abstract Figures No2 Plakat','Abstract Figures No2 Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(8,1,1,'Abstrakcyjna grafika geometryczna z sylwetką ludzką w kolorze czarnym na beżowym tle, z tekstem u góry i u dołu. Jeśli chcesz, żeby Twój dom był ciągle modny, grafiki geometryczne to podstawa! Dopasuj ten obraz do motywu Abstract Figures No2 albo Abstract Figures No3, aby uzyskać idealnie dobraną parę.','Grafika geometryczna z sylwetką ludzką – Grafika geometryczna z abstrakcyjną sylwetką ludzką, narysowana w czarnym kolorze na beżowym tle','abstract-figures-no1-plakat','Abstract Figures No1 Plakat  – Grafika geometryczna z abstrakcyjną sylwetką ludzką, narysowana w czarnym kolorze na beżowym tle - Desenio.pl','abstract, figures, no1, plakat, grafika, geometryczna, z, sylwetką, ludzką, desenio.pl','Abstract Figures No1 Plakat','Abstract Figures No1 Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(9,1,1,'Ilustracja z grafiką geometryczną przedstawiająca abstrakcyjną kobiecą sylwetkę w czarnym kolorze na jasnoszarym tle. Ten minimalistyczny, ręcznie rysowany motyw dobrze się sprawdza w większości domów. Idealnie nadaje się do powieszenia na przykład w salonie.','Grafika geometryczna Peytil– Rysunek z grafiką geometryczną przedstawiającą ciało abstrakcyjnymi liniami','antibes-plakat','Antibes Plakat – Rysunek z grafiką geometryczną przedstawiającą ciało abstrakcyjnymi liniami - Desenio.pl','antibes, plakat, grafika, geometryczna, peytil, desenio.pl','Antibes Plakat','Antibes Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(10,1,1,'Graficzna ilustracja z kształtami geometrycznymi w kolorach czarnym, szarym i brązowym na beżowym tle. Wyrazista faktura plakatu dodaje mu ładnej głębi. Dopasuj go do plakatu Weimar Shapes No2, aby uzyskać idealnie dobraną parę do domu.','Kształty graficzne – Ilustracja w kolorze czarnym, brązowym i szarym z geometrycznymi kształtami na beżowym tle','weimar-shapes-no1-plakat','Weimar Shapes No1 Plakat  – Ilustracja w kolorze czarnym, brązowym i szarym z geometrycznymi kształtami na beżowym tle - Desenio.pl','weimar, shapes, no1, plakat, kształty, graficzne, desenio.pl','Weimar Shapes No1 Plakat','Weimar Shapes No1 Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(11,1,1,'Graficzna ilustracja z beżowym tłem i brązowymi, szarymi i czarnymi kształtami geometrycznymi. Faktura płótna dodaje temu plakatowi efektownej głębi. Zawieszony na ścianie, będzie świetnie pasował do najnowszych trendów.','Półokręgi – Graficzny plakat z kształtami w kolorze czarnym, brązowym i szarym na beżowym tle','weimar-circles-no2-plakat','Weimar Circles No2 Plakat  – Graficzny plakat z kształtami w kolorze czarnym, brązowym i szarym na beżowym tle - Desenio.pl','weimar, circles, no2, plakat, półokręgi, desenio.pl','Weimar Circles No2 Plakat','Weimar Circles No2 Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(12,1,1,'Ilustracje graficzne z czarnymi liniami tworzącymi odwrócony łuk z czarnym kształtem pod spodem, na szare beżowe tle. Struktura kolorystyczna w tym obrazie łączy nowoczesne wzornictwo z lekkim stylem retro.','Łuk z czarnych linii – Abstrakcyjny łuk z linii w kolorze czarnym, z czarnym kształtem na dole, na beżowym tle','berlin-arches-no2-plakat','Berlin Arches No2 Plakat  – Abstrakcyjny łuk z linii w kolorze czarnym, z czarnym kształtem na dole, na beżowym tle - Desenio.pl','berlin, arches, no2, plakat, łuk, z, czarnych, linii, desenio.pl','Berlin Arches No2 Plakat','Berlin Arches No2 Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(13,1,1,'Czarno-białe zdjęcie kobiety ubranej w koszulę, palącej papierosa w oknie. Zdjęcie jest częścią kolekcji „Studio Cosmopolitan”, w ramach której zespół Desenio Design Studio udał się w podróż do miast świata, aby uchwycić ich piękno.','Paryski papieros – Czarno-białe zdjęcie kobiety w zbyt dużej koszuli, palącej papierosa w oknie','smoking-in-paris-plakat','Smoking in Paris Plakat  – Czarno-białe zdjęcie kobiety w zbyt dużej koszuli, palącej papierosa w oknie - Desenio.pl','smoking, in, paris, plakat, paryski, papieros, desenio.pl','Smoking in Paris Plakat','Smoking in Paris Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(14,1,1,'Zdjęcie dużych, różowych i białych piwonii. Ten romantyczny, ładny obraz jest idealnym dodatkiem do domu, w którym inspiracje botaniczne i miękkie róże są na pierwszym planie. Aby uzyskać idealną kompozycję, dopasuj go do innych obrazów botanicznych.','Różowe piwonie – Zbliżenie białej i różowej piwonii w pełnym rozkwicie','coral-sunset-peony-plakat','Coral Sunset Peony Plakat  – Zbliżenie białej i różowej piwonii w pełnym rozkwicie - Desenio.pl','coral, sunset, peony, plakat, różowe, piwonie, desenio.pl','Coral Sunset Peony Plakat','Coral Sunset Peony Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(15,1,1,'Zdjęcie kępy beżowych traw na wietrze z jasnoniebieskim niebem w tle. Stwórz delikatną, harmonijną atmosferę w swoim domu dzięki subtelnym obrazom przyrodniczym. Jeśli szukasz idealnie dobranej pary do swojego domu, ten obraz będzie dobrze pasował do obrazu In the Reeds No1.','Kępa traw – Zdjęcie beżowych traw na wietrze, na tle jasnoniebieskiego nieba','in-the-reeds-no2-plakat','In the Reeds No2 Plakat  – Zdjęcie beżowych traw na wietrze, na tle jasnoniebieskiego nieba - Desenio.pl','in, the, reeds, no2, plakat, kępa, traw, desenio.pl','In the Reeds No2 Plakat','In the Reeds No2 Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(16,1,1,'Zdjęcie jednego złota i jednego zielonego liścia palmowego na beżowym, kamiennym tle. Plakaty botaniczne dodają nie tylko odrobinę koloru do domowych wnętrz, ale także je ożywiają i odświeżają!','Liście palmowe – Zdjęcie dwóch liści palmowych w kolorze zielonym i złotym na kamiennym, beżowym tle','golden-leaves-plakat','Golden leaves Plakat  – Zdjęcie dwóch liści palmowych w kolorze zielonym i złotym na kamiennym, beżowym tle - Desenio.pl','golden, leaves, plakat, liście, palmowe, desenio.pl','Golden leaves Plakat','Golden leaves Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(17,1,1,'Zdjęcie małych białych kwiatków na rozmytym tle. Udekoruj swój dom artystycznymi zdjęciami botanicznymi w spokojnych kolorach ziemi. W ten sposób stworzysz domowe wnętrze, w którym można odpocząć i poczuć odprężenie po stresującym dniu.','Białe kwiaty – Zbliżenie małych okrągłych kwiatków w kolorze białym, z rozmytym tłem','autumn-nature-plakat','Autumn Nature Plakat  – Zbliżenie małych okrągłych kwiatków w kolorze białym, z rozmytym tłem - Desenio.pl','autumn, nature, plakat, białe, kwiaty, desenio.pl','Autumn Nature Plakat','Autumn Nature Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(18,1,1,'Czarno-białe zdjęcie kobiety w sukience, idącej obok lamp ulicznych, z parasolem, pod Wieżą Eiffla. Miasto miłości budzi podziw wielu osób, a zdjęcie do tego obrazu zostało zrobione przez Desenio Design Studio w Paryżu.','Spacer po Paryżu – Czarno-białe zdjęcie kobiety spacerującej z parasolem pod Wieżą Eiffla','walking-in-paris-plakat','Walking in Paris Plakat  – Czarno-białe zdjęcie kobiety spacerującej z parasolem pod Wieżą Eiffla - Desenio.pl','walking, in, paris, plakat, spacer, po, paryżu, desenio.pl','Walking in Paris Plakat','Walking in Paris Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(19,1,1,'Czarno-białe zdjęcie kobiety w białej koszuli, odsłaniającej ramię. Zmysłowe zdjęcia artystyczne to styl, który uwielbiamy, a ten obraz dobrze pasuje zarówno do innych czarno-białych fotografii, jak i plakatów botanicznych.','Odsłonięte ramię – Czarno-białe zdjęcie odsłoniętego kobiecego ramienia w białej koszuli','shoulder-plakat','Shoulder Plakat  – Czarno-białe zdjęcie odsłoniętego kobiecego ramienia w białej koszuli - Desenio.pl','shoulder, plakat, odsłonięte, ramię, desenio.pl','Shoulder Plakat','Shoulder Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(20,1,1,'Czarno-białe zdjęcie ze zdjęciem kobiety wyglądającej przez okno z widokiem na Łuk Triumfalny w Paryżu. Tego rodzaju klasyczny motyw dekoracyjny doskonale pasuje do każdego domu i stanowi dopełnienie wystroju w dowolnym stylu. Dopasuj go do innych plakatów z fotografiami, aby stworzyć modną ścianę z obrazami i artystyczny dom.','Kobieta w Paryżu – Czarno-białe zdjęcie kobiety w oknie, z Łukiem Triumfalnym w tle','girl-in-window-plakat','Girl In Window Plakat  – Czarno-białe zdjęcie kobiety w oknie, z Łukiem Triumfalnym w tle - Desenio.pl','girl, in, window, plakat, kobieta, w, paryżu, desenio.pl','Girl In Window Plakat','Girl In Window Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(21,1,1,'Abstrakcyjna ilustracja z czarno-białymi liniami i kształtami na akwarelowym, szare beżowym tle. Znajdź swoje nowe ulubione obrazy w naszej ofercie sztuki abstrakcyjnej. W tej kategorii każdy znajdzie coś dla siebie. Dopasuj ten obraz do motywu Soft Abstract No2, a uzyskasz idealną parę.','Beżowe abstrakcje – Ilustracja z abstrakcyjnymi kształtami i liniami w kolorach białym i czarnym na beżowym, akwarelowym tle','soft-abstract-lines-no1-plakat','Kupuj popularne obrazy online, na stronie Desenio.pl Wybieraj spośród mnóstwa modnych plakatów w stylu skandynawskim. Szybka dostawa i wiele zadowolonych klientów. Plakaty i reprodukcje ze sztuką nowoczesną w najlepszym stylu.','','Soft Abstract Lines No1 Plakat','Soft Abstract Lines No1 Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(22,1,1,'Abstrakcyjna ilustracja twarzy w stylu grafiki geometrycznej w kolorach beżowym i jasnoszarym, na beżowym tle. W naszej ofercie znajduje się wiele obrazów w stylu abstrakcyjnym, które przypadną do każdego gustu. Aby stworzyć idealnie dobraną parę, dopasuj ten obraz do plakatu Abstract Lines and Shapes No2.','Abstrakcyjna twarz – Ilustracja z abstrakcyjnymi kształtami i grafiką geometryczną twarzy na beżowym tle','abstract-lines-and-shapes-no1-plakat','Kupuj popularne obrazy online, na stronie Desenio.pl Wybieraj spośród mnóstwa modnych plakatów w stylu skandynawskim. Szybka dostawa i wiele zadowolonych klientów. Plakaty i reprodukcje ze sztuką nowoczesną w najlepszym stylu.','','Abstract Lines and Shapes No1 Plakat','Abstract Lines and Shapes No1 Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(23,1,1,'Abstrakcyjna ilustracja graficzna z liniami i kształtami w kolorach czarnym i beżowym. Rozbudź swoją kreatywność i stwórz ścianę z obrazami wypełnioną plakatami artystycznymi. Grafika to nowoczesny styl, który zawsze pasuje do każdego wnętrza.','Beżowa grafika artystyczna – Graficzne czarne linie i beżowe kształty','beige-graphics-no1-plakat','Beige Graphics No1 Plakat  – Graficzne czarne linie i beżowe kształty - Desenio.pl','beige, graphics, no1, plakat, beżowa, grafika, artystyczna, desenio.pl','Beige Graphics No1 Plakat','Beige Graphics No1 Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(24,1,1,'Abstrakcyjny obraz w kolorach granatowym i złotym. Oryginał namalowano farbami akrylowymi na płótnie, dzięki czemu na plakacie są widoczne pociągnięcia pędzlem i faktura płótna. Sztuka abstrakcyjna powinna znaleźć się w każdym domu! Ten styl ma w sobie coś dla każdego. Bogate i głębokie kolory na tym obrazie sprawiają, że idealnie nadaje się on na wyrazisty element wystroju wnętrz.','Abstrakcja w granacie i złocie – Abstrakcyjny obraz olejny z niebieskimi i złotymi zawijasami','blue-gold-plakat','Blue Gold Plakat  – Abstrakcyjny obraz olejny z niebieskimi i złotymi zawijasami - Desenio.pl','blue, gold, plakat, abstrakcja, w, granacie, i, złocie, desenio.pl','Blue Gold Plakat','Blue Gold Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(25,1,1,'Abstrakcyjny obraz w kolorach białym, niebieskim i złotym. Oryginał namalowano farbami akrylowymi na płótnie, dzięki czemu na plakacie są widoczne pociągnięcia pędzlem i faktura płótna. Jeśli chcesz stworzyć piękny dom, sztuka abstrakcyjna będzie dla Ciebie najlepszym wyborem! Dzięki śmiałym zawijasom i kolorom ten plakat stworzy wrażenie luksusu.','Obraz olejny – Obraz olejny z abstrakcyjnymi wzorami w kolorach złotym, niebieskim i białym','blue-tide-plakat','Blue Tide Plakat  – Obraz olejny z abstrakcyjnymi wzorami w kolorach złotym, niebieskim i białym - Desenio.pl','blue, tide, plakat, obraz, olejny, desenio.pl','Blue Tide Plakat','Blue Tide Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(26,1,1,'Graficzna ilustracja z abstrakcyjnymi kształtami i okręgami w kolorach niebieskim, brązowym i pomarańczowym na jasnobeżowym tle. Dodanie kilku wyrazistych kolorów ożywi ściany! Jeśli nie przepadasz za mocniejszymi tonacjami, ten obraz wykonano w wyciszonych, neutralnych odcieniach, które będą świetnie wyglądać w salonie.','Abstrakcyjne kształty – Abstrakcyjna grafika z abstrakcyjnymi kształtami w kolorach niebieskim i pomarańczowym na beżowym tle','cyra-plakat','Cyra Plakat  – Abstrakcyjna grafika z abstrakcyjnymi kształtami w kolorach niebieskim i pomarańczowym na beżowym tle - Desenio.pl','cyra, plakat, abstrakcyjne, kształty, desenio.pl','Cyra Plakat','Cyra Plakat','W Magazyni